        $this->addSql('INSERT INTO indicator VALUES (1,"Emisiones por Habitante","tCO₂eq / habitante","Inventario total de GEI de la República Argentina dividido por la cantidad de habitantes (Población Total). \rFuente: Censos 1990/2001/2010/ Proyeccion 2010/2040. Instituto Nacional de Estadística y Censos (INDEC). Los años intermedios han sido interpolados linealmente.\n"),(2,"Emisiones por Producto Interno Bruto","tCO₂eq / millones de $ 2004","Inventario total de GEI de la República Argentina dividido por el Producto Interno Bruto.\rFuente: Instituto Nacional de Estadística y Censos (INDEC). Valores anuales a precios constantes del 2004. No se cuenta con serie histórica oficial anterior al 2004 (año base) luego del cambio de metodología de cálculo realizado en el año 2012."),(3,"Emisiones por Unidad de Energia","tCO₂eq / tep","Emisiones de GEI del sector \"1.Energía\" dividido por la Oferta Interna Total. Se define a la Oferta Interna Total = Oferta Interna Primaria + Importaciones Fuentes Secundarias-Exportaciones Fuentes Secundarias. La Oferta Interna Total representa la energía efectivamente disponible para ser transformada (refinerías, planta de tratamiento de gas, carboneras, etc.), ser consumida en el propio sector energético, o ser consumida por los usuarios finales dentro del país. \rFuente: Balance Energético Nacional - Ministerio de Energía y Minería (MinEM)."),(4,"Emisiones por Unidad de Energía Electrica","tCO₂eq / MWh","Emisiones de GEI de la categoría \"1.A.1.a - Producción de electricidad y calor como actividad principal\" dividido por la generación total de energía eléctrica conectada a la red. \rFuente: Informe del Sector Eléctrico - Ministerio de Energía y Minería (MinEM)."),(5,"Emisiones Industria por Valor Bruto de la Produccion","tCO₂eq / millones de $ 2004","Emisiones de GEI de las categorías \"1.A.1.a - Producción de electricidad y calor como actividad principal (proporcional sector industria)\", \"1.A.2  -Industrias manufactureras y de la construcción\", \"2. Procesos Industriales y Uso de Productos\"  y \"4.D.2 - Aguas residuales Industriales\" dividido por el Valor Bruto de la Producción de la  Industria manufacturera. (El sector comprende las actividades dedicadas a la transformación física y química de materiales, sustancias o componentes en productos nuevos (Letra D)). \rFuente: Instituto Nacional de Estadística y Censos (INDEC). Valores anuales a precios constantes del 2004. No se cuenta con serie histórica oficial anterior al 2004 (año base) luego del cambio de metodología de cálculo realizado en el año 2012. En el caso de la energía eléctrica consumida por la industria, la misma se estimó en base a la facturación por sector. \rFuente: Informe del Sector Eléctrico - Ministerio de Energía y Minería (MinEM)."),(6,"Emisiones por Cabeza de Ganado Bovino","tCO₂eq / Cabeza","Inventario de las categorías \"3.A.1.a- Fermentación Entérica\", \"3.A.2.a - Gestión de Estiércol\", y \"3.C.4 / 3.C.5 - Excretas en pasturas de los bovinos\" dividido por la cantidad de cabezas de ganado bovino. \rFuente: Servicio Nacional de Sanidad y Calidad Agroalimentaria (SENASA)"),(7,"Emisiones producción de Granos","tCO₂eq/ t Grano","Inventario de las categorías \"3.C.1 - Quemas de Biomasa\", \"3.C.3 - Aplicación de Urea\", \"3.C.4 /3.C.5 - Residuos de Cosecha y Fertilizantes Sintéticos\", \"3.C.7 - Producción de Arroz\" y \"3.B /3.C.4/3.C.5 - Cambio de Carbono en los suelos\" dividido por la producción de cultivos (Soja, Trigo, Maiz, Algodón, Arroz, Avena, Cebada cervecera, Cebada forrajera, Centeno, Colza, Girasol, Lino, Mani, Mijo, Poroto seco, y Sorgo). \rFuente:  Datos Abiertos - Ministerio de Agroindustria (MinAGRO)."),(8,"Emisiones RSU por Habitante","tCO₂eq / Habitante","Inventario de las categorías \"4.A - Eliminación de residuos sólidos\" y \"4.C - Incineración de residuos\" dividido por la cantidad de habitantes (Población Total). \rFuente: Censos 1990/2001/2010/ Proyeccion 2010/2040. Instituto Nacional de Est